import React from 'react';


const Header = () =>{
    return(
        <div className='row justify-content-center header_row'>
        <header className='header col-9'>
          <img src='karman2.png'></img>
          <img src='karman_text.png'></img>
        </header>
      </div>
    );
}
export default Header;
